// src/Home.js
import React from 'react';

function Home() {
    return (
        <div style={{ textAlign: 'center', marginTop: '50px' }}>
            <h1>Welcome to the Home Page!</h1>
            <p>You have successfully logged in.</p>
        </div>
    );
}

export default Home;
